import React from "react";
import Data from "../../Entites/Data";
import { MainConteiner, IconsConteiner, Vector } from "./style";

export default function Footer() {
  const { Links } = Data.person;
  return (
    <MainConteiner>
      <Vector />
      <IconsConteiner>
        {Links.map((Links) => (
          <a key={Links.id} href={Links.url}>
            {Links.icon}
          </a>
        ))}
      </IconsConteiner>
    </MainConteiner>
  );
}
